import React, { useState, useEffect } from 'react';

function Contact() {
  const [buildings, setBuildings] = useState([]);

  useEffect(() => {
    // Fetch building data from the API
    fetch('http://localhost:4000/zgrade')
      .then((response) => response.json())
      .then((data) => {
        console.log('Fetched data:', data); // Log the data to see its structure
        setBuildings(data);
      })
      .catch((error) => console.error('Error fetching buildings:', error));
  }, []);
  

  return (
<div className="building-list">
  {Array.isArray(buildings) && buildings.length > 0 ? (
    buildings.map((building) => (
      <div key={building.id} className="building-item">
        <h2>{building.name}</h2>
        <img src={building.image_url} alt={building.name} width="300" />
      </div>
    ))
  ) : (
    <p>No buildings available</p>
  )}
</div>

  );
}

export default Contact;
